import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

function Navbar(){
    return(
        <Form inline>
            <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
                <Input placeholder="Search Images" width="100%"></Input>
            </FormGroup>
        </Form>
    );
}

export default Navbar
